(16, 'chatroll', ' chatroll apiu800 chatrollu82ecomu800 chatroll apiu800 chatrollu82ecomu800 chatroll apiu800 chatrollu82ecomu800 ---- introduction introduction introduction chatroll apiu800 foru800 team collaboration platform. ---- purpose purpose purpose chat platform foru800 collaboration between theu800 team. there exist au800 group chat andu800 private chat with persons online. ---- usability steps usability steps usability steps #direct yourself tou800 theu800 landing page indexu82ephpu800 #user canu800 create au800 free chatroll account tou800 prove tou800 beu800 au800 genuine identity. #user canu800 also login tou800 prove identity using their personal facebook oru800 twitter account. #user canu800 access tcrc chat using au800 guest account. however guest details areu800 deleted after theu800 session isu800 finished. ---- implementation implementation implementation direct tou800 login tou800 theu800 admin chat controls using theu800 credentials below username tcrcadmin password admin123 learn theu800 activity using theu800 analytics tabu800 onu800 theu800 settings tabu800 manage 1u800. look andu800 feel ofu800 theu800 chat tabu800 2u800. theu800 appearance ofu800 theu800 chatbox 3u800. access tabu800 canu800 help youu800 manage theu800 capacity ofu800 users 10u800 users inu800 theu800 free version andu800 theu800 signin option 4u800. access tabu800 will help youu800 disable guest users 5u800. users tabu800 will help youu800 switch mange theu800 users andu800 transfer oru800 addu800 admin rights. ---- '),
(17, 'calendar', ' google calendar apiu800 calendaru82egoogleu82ecomu800 google calendar apiu800 calendaru82egoogleu82ecomu800 google calendar apiu800 calendaru82egoogleu82ecomu800 ---- introduction introduction introduction shared calendar foru800 allu800 theu800 team theu800 tcrc team members ---- purpose purpose purpose shared calendar tou800 manage events andu800 ---- usability steps usability steps usability steps #addu800 tcrc shared calendar tou800 your google calendar byu800 clicking googlecalendar icon onu800 theu800 right bottom corner onu800 theu800 landing page indexu82ephpu800 #youu800 canu800 view allu800 theu800 events onu800 theu800 page. #admin should provide theu800 user with editing rights foru800 theu800 user tou800 addu800 events tou800 theu800 calendar. #user adding events should addu800 itu800 from calendaru82egoogleu82ecomu800. #make sure theu800 calendar theu800 event isu800 added tou800 isu800 tcrc 6u800. when admin adds au800 user tou800 edit theu800 tcrc calendar should switch from other calendars tou800 myu800 calendars. ---- giving editing rights tou800 user giving editing rights tou800 user giving editing rights tou800 user direct tou800 login tou800 theu800 admin google calendar account using theu800 credentials below username trentcommunityresearch gmailu82ecomu800 password yon9knyk click onu800 theu800 3u800 vertical dots next tou800 tcrc calendar click onu800 settings andu800 sharing navigate tou800 theu800 share with specific people tabu800 click onu800 addu800 people andu800 theu800 user user\'su800 email address linked with their google calendar. change theu800 permissions tou800 make changes andu800 manage tou800 sharing . ---- '),
(18, 'task manager', ' tou800 dou800 list apiu800 flasku82eiou800 tou800 dou800 list apiu800 flasku82eiou800 tou800 dou800 list apiu800 flasku82eiou800 ---- introduction introduction introduction shared tou800 dou800 list foru800 theu800 team ---- purpose purpose purpose shared tou800 dou800 list mentions allu800 theu800 tasks tou800 complete byu800 theu800 team ---- usability steps usability steps usability steps # navigate tou800 theu800 landing page indexu82ephpu800 # type au800 task name atu800 write your next task here... andu800 click enter # user canu800 setu800 priority byu800 scrolling theu800 task topu800 oru800 bottom. # user canu800 setu800 au800 dueu800 date foru800 theu800 task # user canu800 checkmark theu800 task after itu800 itu800\'su800 done. # user canu800 star task # user canu800 setu800 au800 tagu800 colour. # user canu800 delete theu800 task ---- '),
(19, 'create template', ' creating email template creating email template creating email template ---- introduction introduction introduction creating anu800 html template foru800 drafting email. ---- purpose purpose purpose creating anu800 html template foru800 drafting email. ---- usability steps usability steps usability steps # direct yourself tou800 theu800 # create au800 free stripo account. # click onu800 create your first email . # create anu800 email. # after youu800 have drafted your email. # clicking onu800 theu800 export button onu800 theu800 topu800 menu baru800. # click onu800 download html file # au800 .html file will beu800 downloaded onu800 your computer. # upload that file tou800 theu800 create template file onu800 theu800 crmu800. # click upload template. ---- '),
(20, 'send email', ' send templated email send templated email send templated email ---- introduction introduction introduction send templated emailed from theu800 template youu800 created tou800 au800 specific email. ---- purpose purpose purpose send templated emailed from theu800 template youu800 created tou800 au800 specific email. ---- usability steps usability steps usability steps # direct yourself tou800 send email page. # select theu800 template youu800 uploaded. # click onu800 submit tou800 preview theu800 template selected. # type theu800 email youu800 want tou800 send tou800. # foru800 multiple emails separate emails using commas example hello trentuu82ecau800 world trentuu82ecau800 # type theu800 email subject. # click submit # theu800 message below should change from email send unsucessful tou800 email send sucessful ---- '),
(21, 'send group email', ' send templated email send templated email send templated email ---- introduction introduction introduction send templated emailed from theu800 template youu800 created tou800 au800 bulk oru800 group emails using excel csvu800 import. ---- purpose purpose purpose send templated emailed from theu800 template youu800 created tou800 au800 bulk oru800 group emails using excel csvu800 import. ---- usability steps usability steps usability steps # direct yourself tou800 send group bulk emails page. # download theu800 template foru800 excel import from theu800 page. click onu800 download csvu800 template #  dou800 notu800 change column au800  # inu800 column bu800 type theu800 names # inu800 column cu800 type theu800 emails # select theu800 email template youu800 uploaded. # upload theu800 excel sheet inu800 theu800 .csvu800 format inu800 theu800 given template. # type theu800 email subject. # click submit # theu800 message below should change from email send unsucessful tou800 email send sucessful ---- '),
