(23, 'ldap', ' ldap login installation # tou800 install ldap login edit theu800 code inu800 loginu82ephpu800 # delete allu800 theu800 phpu800 code except from line 159u800 tou800 line 172u800 # input your ldap server information inu800 theu800 code code from line 159u800 tou800 172u800 phpu800 ldap connection here ldap_dn uidu800 . _post username . dcu800 example dcu800 comu800 ; ldap_password _post password ; ldap_con ldap_connect 192u800u82e168u800u82exxu800u82exxu800 389u800 ; addu800 tou800 your active directory protocol here ldap_set_option ldap_con ldap_opt_protocol_version 3u800 ; ifu800 ldap_bind ldap_con ldap_dn ldap_password echo authenticated ; else echo invalid credential ; '),
